import React from 'react'
import {useState ,useRef} from 'react'

const EntryForm = () => {
  const [Firstname ,setFirstname] = useState("");
  const [Lasttname ,setLastname] = useState("");
  const [Carmodel ,setcarmodel] = useState("");
  const [Email ,setEmail] = useState("");
  const [Phoneno,setPhoneno] = useState("");


 const FirstNameInputChangeHanler= event=>
{
  setFirstname(event.target.value);
}
const LastNameInputChangeHanler= event=>
{
  setLastname(event.target.value);
}
const EmailInputChangeHanler= event=>
{
  setEmail(event.target.value);
}
const PhonenoInputChangeHanler= event=>
{
  setPhoneno(event.target.value);
}
const carmodelInputChangeHanler= event=>
{
  setcarmodel(event.target.value);
}

const FormSubmissinHandler = evevt=>{
  evevt.preventDefault();
  console.log(setLastname)
  //alert(Firstname);
}

  return (
    <>
    <div className="container main ">
  <div className="row">
    <div className="col-sm-2 left pt-5">
      <nav className="nav flex-column">
        <a className="nav-link active" aria-current="page" href="/">New Customar</a>
        <a className="nav-link" href="#">Custemar list</a>
      </nav>
    </div>
    <div className="col-sm-10 pt-5">
      <h5>Add New Custemar</h5>

      <div className="col-sm-12 ">

        <div className="container text-center">

          <div className="row justify-content-center">
            <div className="formmain col-sm-9">
              <form className="row" onSubmit={FormSubmissinHandler}>

                <div className="">
                  <label htmlFor="inputEmail4" className="form-label mb-1">Name</label>
                  <input type="text" className="form-control mb-3" placeholder="First name" onChange={FirstNameInputChangeHanler}/>
                </div>
                <div className="">
                  <label htmlFor="inputEmail4" className="form-label mb-1" onChange={LastNameInputChangeHanler}>Last Name</label>
                  <input type="text" className="form-control mb-3" placeholder="Last name"/>
                </div>
                <div className="">
                  <label htmlFor="inputEmail4" className="form-label mb-1" onChange={EmailInputChangeHanler}>Email</label>
                  <input type="email" className="form-control mb-3" id="inputEmail4"  placeholder="Email"/>
                </div>

                <div className="col-12">
                  <label htmlFor="carmodel" className="form-label mb-1" onChange={PhonenoInputChangeHanler}>Car Model</label>
                  <input type="text" className="form-control mb-3" id="carmodel" placeholder="Enter Number CarModel"/>
                </div>
                <div className="col-12">
                  <label htmlFor="phoneno" className="form-label mb-1" onChange={carmodelInputChangeHanler}>Phone Number</label>
                  <input type="text" className="form-control mb-3" id="phoneno" placeholder="Enter Number"/>
                </div>

                <div className="col-12">
                  <button type="submit" className="btn btn-primary mt-3">Submit</button>
                </div>
              </form>
          </div>
          </div>


        </div>



    </div>
    </div>
  </div>
</div>
    </>
  )
}

export default EntryForm
